  null,\n\t\"notes\": \"NOAA's National Geophysical Data Center (NGDC) created a bathymetric
  digital elevation model (DEM) for the Mariana Trench and adjacent seafloor in the
  Western Pacific Ocean.n                    Bathymetric data used in DEM compilation
  were obtained from various sources, including internation, federal and academic
  partners. The DEM is referenced to the horizontal datum ofn                    World
  Geodetic System 1984 (WGS 84) and the vertical datum of sea level. Grid spacings
  for the Mariana Trench DEM is 6 arc-seconds (~180 meters). Please note that while
  positiven                    elevations (elevations greater than 0 meters) are present
  in the DEM over 'dry' land (i.e. islands such as Guam and the Northern Mariana Islands),
  they should be ignored as then                    focus of DEM development was solely
  in the bathymetric realm.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
